<DIV id="id7_1">
<P class="p96 ft60">Pasal 1</P>
<P class="p97 ft61">Definisi</P>
<P class="p98 ft62"><SPAN class="ft62">1.</SPAN><SPAN class="ft63">Jaringan Sewa </SPAN>atau <SPAN class="ft60">Layanan</SPAN> adalah penyediaan jaringan transmisi untuk komunikasi elektronik yang menghubungkan 2 (dua) titik terminasi secara permanen untuk digunakan secara eksklusif dengan kapasitas kanal transmisi yang simetris milik</P>
<P class="p99 ft64">PELANGGAN.</P>
<P class="p100 ft62"><SPAN class="ft62">2.</SPAN><SPAN class="ft63">Infrastruktur </SPAN>adalah jaringan fisik yang menghubungkan 2 (dua) buah jaringan atau lebih antara Data Center dengan gedung lokasi POP (<SPAN class="ft65">Post Office Protocol</SPAN>)</P>
<P class="p100 ft62"><SPAN class="ft62">3.</SPAN><SPAN class="ft63">Downtime </SPAN>adalah kondisi sementara yang menyebabkan terputusnya koneksi jaringan transmisi yang digunakan oleh PELANGGAN, yang diakibatkan oleh gangguan pada Layanan Jaringan Sewa yang disediakan oleh THC, <SPAN class="ft65">end to end </SPAN>dari dan ke tempat PELANGGAN dimana koneksi diinstalasikan.</P>
<P class="p101 ft62"><SPAN class="ft62">4.</SPAN><SPAN class="ft63">Formulir Berlangganan (FB) </SPAN>adalah formulir yang digunakan oleh PELANGGAN untuk mendaftarkan Layanan di THC Formulir tersebut wajib diisi dan diserahkan kepada THC sebelum proses instalasi dapat dilakukan.</P>
<P class="p101 ft62"><SPAN class="ft62">5.</SPAN><SPAN class="ft63">Berita Acara Aktifasi </SPAN>adalah informasi tertulis yang disampaikan THC kepada PELANGGAN sebagai bentuk konfirmasi aktifnya Layanan secara teknis.</P>
<P class="p102 ft64"><SPAN class="ft64">6.</SPAN><SPAN class="ft66">Hari Kerja </SPAN>adalah hari Senin sampai dengan hari Jumat pada setiap minggu dalam bulan tahun kalender yang tidak termasuk hari Sabtu, Minggu, dan hari libur nasional.</P>
<P class="p103 ft64"><SPAN class="ft64">7.</SPAN><SPAN class="ft67"></SPAN><SPAN class="ft68">Hari Kalender</SPAN> adalah setiap hari termasuk hari Sabtu, Minggu, dan hari libur nasional.</P>
<P class="p104 ft68">Pasal 2</P>
<P class="p105 ft61">Ruang Lingkup Layanan</P>
<P class="p106 ft62"><SPAN class="ft62">1.</SPAN><SPAN class="ft69">PELANGGAN berlangganan Layanan yang disediakan oleh THC dengan koneksi yang pesat</SPAN></P>
<P class="p107 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft67">Para Pihak menyediakan peralatan, perlengkapan, serta perizinan yang diperlukan agar dapat menggunakan dan menikmati Layanan yang disediakan.</SPAN></P>
<P class="p108 ft70"><SPAN class="ft70">3.</SPAN><SPAN class="ft71">THC bertanggung jawab atas kualitas Layanan sesuai dengan</SPAN></P>
<P class="p109 ft65">Service Level Agreement</P>
<P class="p96 ft68">Pasal 3</P>
<P class="p110 ft61">Jangka Waktu Layanan</P>
<P class="p106 ft64"><SPAN class="ft64">1.</SPAN><SPAN class="ft67">Perjanjian ini berlaku selama Para Pihak sepakat dan mengikatkan diri dengan Form Berlangganan ( FB )</SPAN></P>
<P class="p111 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft67">Jangka waktu Layanan akan diatur dan disepakati dalam masing- masing Form Berlangganan</SPAN></P>
<P class="p100 ft64"><SPAN class="ft64">3.</SPAN><SPAN class="ft67">Jangka Waktu Perjanjian ini akan selalu diperpanjang secara otomatis untuk jangka waktu 12 (dua belas) bulan berikutnya apabila dalam jangka waktu 1 (satu) bulan sebelum Jangka Waktu Perjanjian berakhir, salah satu pihak tidak menerima pemberitahuan secara tertulis untuk mengakhiri Perjanjian.</SPAN></P>
</DIV>
<DIV id="id7_2">
<P class="p112 ft60">Article 1</P>
<P class="p113 ft61">Definitions</P>
<P class="p114 ft62"><SPAN class="ft62">1.</SPAN><SPAN class="ft72">Leased Line </SPAN>or "<SPAN class="ft60">Service</SPAN>" shall means providing transmission network for electronic communication which connects 2 (two) termination points permanently to be used exclusively with symmetric transmission channel capacity owned by the CUSTOMERS.</P>
<P class="p115 ft62"><SPAN class="ft62">2.</SPAN><SPAN class="ft72">Infrastructure </SPAN>shall means infrastructure line connecting 2 (two) or more infrastructures between Data Center and POP (Post Office Protocol) building.</P>
<P class="p116 ft62"><SPAN class="ft62">3.</SPAN><SPAN class="ft72">Downtime </SPAN>shall mean a temporary circumstance which cause damage to link transmission ceases to function, due to disturbance to the Leased Line as provided by THC, <NOBR>end-to-end</NOBR> from and to CUSTOMERs premise where connection installed to THCs supplier.</P>
<P class="p115 ft62"><SPAN class="ft62">4.</SPAN><SPAN class="ft72">Subscription Form (FB) </SPAN>shall means a form used by the CUSTOMER to register for Service with THC The form must be completed and submitted to THC before the installation process may commence.</P>
<P class="p117 ft62"><SPAN class="ft62">5.</SPAN><SPAN class="ft73"></SPAN><SPAN class="ft60">Minutes of Activation</SPAN>" shall means a written information delivered by THC. to the CUSTOMER, as a form of confirmation of the activation of Service technically.</P>
<P class="p116 ft64"><SPAN class="ft64">6.</SPAN><SPAN class="ft74"></SPAN><SPAN class="ft68">Working Day(s)</SPAN> shall means the day from Monday to Friday in every week in a calendar year that does not include Saturday, Sunday and public holidays.</P>
<P class="p118 ft64"><SPAN class="ft64">7.</SPAN><SPAN class="ft75"></SPAN><SPAN class="ft68">Calendar Day(s)</SPAN> shall means every day including Saturday, Sunday and public holidays.</P>
<P class="p119 ft68">Article 2</P>
<P class="p120 ft61">Scope of the Service</P>
<P class="p121 ft62"><SPAN class="ft62">1.</SPAN><SPAN class="ft69">CUSTOMER shall subscribe to the Service provided by THC with rapid connection</SPAN></P>
<P class="p122 ft76"><SPAN class="ft76">2.</SPAN><SPAN class="ft77">The Parties shall provide the equipment, supplies, and all permits required in order to use and enjoy the provided Services.</SPAN></P>
<P class="p123 ft64"><SPAN class="ft64">3.</SPAN><SPAN class="ft67">THC shall be held responsible for the quality of the Service according to the Service Level Agreement</SPAN></P>
<P class="p124 ft68">Article 3</P>
<P class="p125 ft61">Terms of the Services</P>
<P class="p126 ft64"><SPAN class="ft64">1.</SPAN><SPAN class="ft78">This Agreement is valid as long as the Parties agree and binding themselves by signing the Subscription Form</SPAN></P>
<P class="p127 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft78">The terms of Service will be regulate and agreed upon each Subscription Form</SPAN></P>
<P class="p128 ft64"><SPAN class="ft64">3.</SPAN><SPAN class="ft78">This Agreement will always be extended automatically for the subsequent period of 12 (twelve) months in the event that within a period of 1 (one) month prior to the expiration of the Period of the Agreement, one of the Parties does not receive any written notification to terminate the Agreement.</SPAN></P>
</DIV>
