<P class="p96 ft60">Pasal 4</P>
<P class="p129 ft61">Hak Dan Kewajiban</P>
<P class="p55 ft64"><SPAN class="ft64">1.</SPAN><SPAN class="ft67">PELANGGAN:</SPAN></P>
<P class="p100 ft62"><SPAN class="ft62">a.</SPAN><SPAN class="ft69">Dapat mengajukan perubahan layanan baik kapasitas dan kualitas (</SPAN><SPAN class="ft65">upgrade </SPAN>maupun <SPAN class="ft65">downgrade)</SPAN>, setelah terlebih dahulu mengajukan permohonan tertulis kepada THC paling lambat 14 (empat belas) Hari Kalender sebelum tanggal yang diinginkan. Penagihan akan dilakukan secara pro rata bila perubahan tidak dilakukan pada hari pertama setiap bulannya. Penagihan secara pro rata akan berlaku untuk Layanan baru.</P>
<P class="p100 ft62"><SPAN class="ft62">b.</SPAN><SPAN class="ft69">Berhak untuk menikmati segala manfaat dan keuntungan yang diperoleh melalui penyediaan Layanan ini sesuai dengan jenis Layanan </SPAN><NOBR>masing-masing</NOBR> dan dengan Para Pihak tunduk pada hukum dan peraturan yang berlaku di wilayah hukum Republik Indonesia.</P>
<P class="p130 ft62"><SPAN class="ft62">c.</SPAN><SPAN class="ft79">Dilarang untuk melakukan tindakan yang menimbulkan gangguan pada jaringan atau sistem komputer dan segala tindakan lain yang dapat dianggap melanggar hukum dan peraturan yang</SPAN></P>
<P class="p131 ft64">berlaku di wilayah hukum Republik Indonesia.</P>
<P class="p34 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft67">THC :</SPAN></P>
<P class="p132 ft76"><SPAN class="ft76">a.</SPAN><SPAN class="ft80">Wajib menyediakan Layanan sebagaimana diperjanjikan sesuai dengan Ketentuan Dan Syarat Khusus Berlangganan Leased Circuit</SPAN></P>
<P class="p133 ft62"><SPAN class="ft62">b.</SPAN><SPAN class="ft81">Wajib merahasiakan segala informasi mengenai PELANGGAN kecuali untuk tujuan penyelidikan atau segala hal yang berkaitan dengan penegakan hukum yang dilakukan oleh Polisi Republik Indonesia dan/atau pejabat penyidik yang berwenang menurut </SPAN><NOBR>undang-undang</NOBR> dan peraturan yang berlaku.</P>
<P class="p133 ft62"><SPAN class="ft62">c.</SPAN><SPAN class="ft82">Wajib melakukan pemeriksaan rutin dan aktifitas lainnya termasuk perbaikan demi kepentingan Layanan dan keamanan, dengan tetap menjaga ketentuan ketersediaan. Pemerikasaan rutin akan diinformasikan kepada PELANGGAN melalui email atau menghubungi langsung selambatnya 30 (tiga puluh) Hari Kalendar sebelumnya, PELANGGAN berhak untuk meminta perubahan jadwal pemerikasaan apabila alokasi waktu berdampak pada</SPAN></P>
<P class="p134 ft64">PELANGGAN.</P>
<P class="p135 ft64"><SPAN class="ft64">d.</SPAN><SPAN class="ft83">Dilarang mengalihkan Layanan kepada pihak ketiga tanpa izin tertulis dari PELANGGAN.</SPAN></P>
<P class="p132 ft62"><SPAN class="ft62">e.</SPAN><SPAN class="ft81">Dilarang untuk melakukan tindakan yang menimbulkan gangguan pada jaringan atau sistem komputer dan segala tindakan lain yang dapat dianggap melanggar hukum dan peraturan yang berlaku di wilayah hukum Republik Indonesia.</SPAN></P>
<P class="p132 ft62"><SPAN class="ft62">f.</SPAN><SPAN class="ft84">Wajib untuk memperhatikan dan memperoleh segala perizinan berdasarkan peraturan yang berlaku pada setiap situs internet, komunitas, dan memperhatikan kebijakan PELANGGAN.</SPAN></P>
<P class="p136 ft64"><SPAN class="ft64">g.</SPAN><SPAN class="ft83">THC bertanggung jawab untuk membuktikan bahwa Jasa Layanan telah memenuhi </SPAN><SPAN class="ft85">Service Level Agreement </SPAN>dan standar kualitas</P>
<P class="p132 ft62"><SPAN class="ft62">h.</SPAN><SPAN class="ft81">Wajib memberikan pemberitahuan tertulis kepada PELANGGAN 14 (empat belas) Hari Kalender sebelum jangka waktu Form Berlangganan</SPAN></P>
<P class="p137 ft76"><SPAN class="ft76">i.</SPAN><SPAN class="ft86">Wajib memberikan prosedur eskalasi berdasarkan gangguan yang dialami oleh PELANGGAN</SPAN></P>
</DIV>
<DIV id="id8_1_2">
<P class="p112 ft60">Article 4</P>
<P class="p138 ft61">Rights and Obligations</P>
<P class="p55 ft64"><SPAN class="ft64">1.</SPAN><SPAN class="ft67">CUSTOMER:</SPAN></P>
<P class="p139 ft76"><SPAN class="ft76">a.</SPAN><SPAN class="ft87">CUSTOMER may request for changing of Service capacity and quality (upgrade/downgrade), whereas any request to change should be made by written notification and accepted by THC in 14 (fourteen) Calendar </SPAN><SPAN class="ft88">D</SPAN>ays prior the requested period. Charges shall be prorated if a change is not executed the first day in a month. Prorated charges shall be applied to new Services.</P>
<P class="p140 ft62"><SPAN class="ft62">b.</SPAN><SPAN class="ft84">Reserves the rights to enjoy any benefits and advantages acquired through the provisions of these Services in accordance with each Service type and by both Parties abiding to the laws and regulations applicable within territory of the Republic of Indonesia.</SPAN></P>
<P class="p140 ft62"><SPAN class="ft62">c.</SPAN><SPAN class="ft89">Is prohibited to take actions which will lead to the occurrence of problems to the infrastructure or computer network, and any other actions which may be considered as violation of Law and</SPAN></P>
<P class="p141 ft64">regulations applicable in Indonesia.</P>
<P class="p142 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft78">THC :</SPAN></P>
<P class="p128 ft62"><SPAN class="ft62">a.</SPAN><SPAN class="ft79">Shall be obligated to provide Services as stated in the Agreement according to the Terms and Special Condition on Leased Circuit Subscribe</SPAN></P>
<P class="p143 ft76"><SPAN class="ft76">b.</SPAN><SPAN class="ft90">Shall be obligated to keep confidential all information related to the CUSTOMER , except for the purpose of investigation or anything that relates to law enforcement carried out by the Indonesian Police Force and/or authorized investigating officials in accordance with the applicable laws and regulations.</SPAN></P>
<P class="p128 ft62"><SPAN class="ft62">c.</SPAN><SPAN class="ft79">Shall be obligated to carry out the scheduled maintenance and other activities including enhancement for Service and security purposes, while maintaining availability requirements. The scheduled maintenance will be informed to the CUSTOMER by email or direct contact not later than 30 (thirty) Calendar Days prior to execution, the CUSTOMER should have the right to request a change of maintenance schedule if the time allocation has an impacte to the CUSTOMER.</SPAN></P>
<P class="p144 ft64"><SPAN class="ft64">d.</SPAN><SPAN class="ft78">Is prohibited to transfer Service to a third party without written approval from the CUSTOMER.</SPAN></P>
<P class="p128 ft64"><SPAN class="ft64">e.</SPAN><SPAN class="ft78">Is prohibited to take actions which lead to the occurrence of problems to the infrastructure or computer network and any other actions which may be considered as violation of Law and regulations applicable in Republic of Indonesia.</SPAN></P>
<P class="p128 ft62"><SPAN class="ft62">f.</SPAN><SPAN class="ft91">Shall be obligate and obtain all license to abide by the applicable rules in each Internet site, community and by the policies of CUSTOMER.</SPAN></P>
<P class="p145 ft64"><SPAN class="ft64">g.</SPAN><SPAN class="ft78">THC has sole responsibility to prove that they have fulfilled any Service Level Agreement and quality measures</SPAN></P>
<P class="p127 ft64"><SPAN class="ft64">h.</SPAN><SPAN class="ft78">Shall be obligate to give written notice 14 (fourteen) Calendar Days before the expiration date of the Subscription Form</SPAN></P>
<P class="p146 ft76"><SPAN class="ft76">i.</SPAN><SPAN class="ft92">Shall be obligated to serve an escalation procedure based on the disturbance experienced by the CUSTOMER</SPAN></P>
</DIV>
