<P class="p152 ft62">14 (empat belas) Hari Kalender sebelum tanggal berakhirnya Perjanjian dan wajib membayar 50% ( 50 persen ) dari biaya berlangganan untuk sisa bulan berjalan.</P>
<P class="p102 ft64"><SPAN class="ft64">2.</SPAN><SPAN class="ft67">PELANGGAN dapat menghentikan Layanan </SPAN><NOBR>sewaktu-waktu</NOBR> tanpa membayar biaya berlangganan untuk sisa bulan berjalan, jika terjadi salah satu atau lebih <NOBR>hal-hal</NOBR> di bawah ini:</P>
<P class="p153 ft64"><SPAN class="ft64">a.</SPAN><SPAN class="ft67">Jasa Layanan tidak memenuhi syarat dan ketentuan yang diatur dalam Perjanjian ini termasuk Service Level Agreement .</SPAN></P>
<P class="p154 ft64"><SPAN class="ft64">b.</SPAN><SPAN class="ft67">THC mengajukan permohonan pengakhiran Perjanjian.</SPAN></P>
<P class="p109 ft64"><SPAN class="ft64">c.</SPAN><SPAN class="ft78">THC dibubarkan atau pailit.</SPAN></P>
<P class="p109 ft64"><SPAN class="ft64">d.</SPAN><SPAN class="ft67">apabila terjadi keadaan memaksa (force majeure);</SPAN></P>
<P class="p155 ft76"><SPAN class="ft76">e.</SPAN><SPAN class="ft77">Sebagian besar aset dari THC telah disita berdasarkan putusan pengadilan atau badan berwenang lainnya, sehingga diperkirakan akan mempengaruhi kesanggupan THC dalam melaksanakan kewajibannya berdasarkan Perjanjian ini.</SPAN></P>
<P class="p153 ft62"><SPAN class="ft62">f.</SPAN><SPAN class="ft95">Apabila berdasarkan suatu peraturan perundangan yang berlaku di kemudian hari atau berdasarkan kebijakan pemerintah terhadap THC yang mengharuskan .THC</SPAN></P>
<P class="p156 ft76">mengakhiri Perjanjian ini<SPAN class="ft96">.</SPAN></P>
<P class="p152 ft64">Pengakhiran tersebut tidak melepaskan segala hak PELANGGAN untuk menuntut atas pengakhiran serta akibat pengakhiran Perjanjian ini.</P>
<P class="p100 ft62"><SPAN class="ft62">3.</SPAN><SPAN class="ft69">THC berhak untuk membekukan atau memutuskan layanan sebelum PELANGGAN menyatakan untuk berhenti berlangganan dalam keadaan :</SPAN></P>
<P class="p157 ft64"><SPAN class="ft64">a.</SPAN><SPAN class="ft83">PELANGGAN lalai melunasi kewajibannya sesuai dengan prosedur yang telah ditentukan dalam Perjanjian ini; atau</SPAN></P>
<P class="p158 ft64"><SPAN class="ft64">b.</SPAN><SPAN class="ft83">PELANGGAN telah melakukan pelanggaran terhadap </SPAN><NOBR>larangan-larangan</NOBR> sebagaimana telah diatur dalam perjanjian ini, atau;</P>
<P class="p158 ft62"><SPAN class="ft62">c.</SPAN><SPAN class="ft82">Adanya permintaan dari pejabat penyidik negara guna kepentingan penyidikan sesuai peraturan dan hukum yang berlaku di Republik Indonesia, atau</SPAN></P>
<P class="p157 ft64"><SPAN class="ft64">d.</SPAN><SPAN class="ft83">PELANGGAN mengajukan permohonan pengakhiran Perjanjian.</SPAN></P>
<P class="p154 ft64"><SPAN class="ft64">e.</SPAN><SPAN class="ft83">PELANGGAN dibubarkan atau pailit.</SPAN></P>
<P class="p109 ft62"><SPAN class="ft62">f.</SPAN><SPAN class="ft84">apabila terjadi keadaan memaksa (force majeure);</SPAN></P>
<P class="p158 ft64"><SPAN class="ft64">g.</SPAN><SPAN class="ft83">Sebagian besar aset dari PELANGGAN telah disita berdasarkan putusan pengadilan atau badan berwenang lainnya, sehingga diperkirakan akan mempengaruhi</SPAN></P>
<P class="p159 ft64">kesanggupan PELANGGAN dalam melaksanakan kewajibannya berdasarkan Perjanjian ini.</P>
<P class="p158 ft62"><SPAN class="ft62">h.</SPAN><SPAN class="ft81">Apabila berdasarkan suatu peraturan perundangan yang berlaku di kemudian hari atau berdasarkan kebijakan pemerintah terhadap PELANGGAN yang mengharuskan</SPAN></P>
<P class="p160 ft76">PELANGGAN mengakhiri Perjanjian ini<SPAN class="ft97">.</SPAN></P>
<P class="p152 ft76">Pengakhiran tersebut tidak melepaskan segala hak THC untuk menuntut atas pengakhiran serta akibat pengakhiran Perjanjian ini.</P>
<P class="p130 ft62"><SPAN class="ft62">4.</SPAN><SPAN class="ft69">Segala hak dan kewajiban yang masih menjadi tanggung jawab </SPAN><NOBR>masing-masing</NOBR> Pihak yang belum terselesaikan dan telah timbul sebelum diakhirinya Perjanjian tetap menjadi tanggung jawab <NOBR>masing-masing</NOBR> pihak untuk menyelesaikannya.</P>
<P class="p130 ft70"><SPAN class="ft70">5.</SPAN><SPAN class="ft71">Atas pengakhiran Perjanjian sebagaimana diatur dalam Perjanjian ini, Para Pihak sepakat untuk mengesampingkan ketentuan yang diatur dalam Pasal 1266 dan 1267 Kitab Undang- Undang Hukum Perdata (KUHPer).</SPAN></P>
