<P class="p161 ft76">advance and shall only be obligated to pay 50 % ( 50 percent) from the remaining subscription fee.</P>
<P class="p162 ft62"><SPAN class="ft62">2.</SPAN><SPAN class="ft69">The CUSTOMER may terminate the Service in any time without paying the Subcription Fee for the remaining month, in case of one or more of the following:</SPAN></P>
<P class="p163 ft64"><SPAN class="ft64">a.</SPAN><SPAN class="ft67">Internet Service did not fullfil the terms and condition as regulate in this Agreement including the Service Level Agreement .</SPAN></P>
<P class="p154 ft64"><SPAN class="ft64">b.</SPAN><SPAN class="ft67">THC is applying for termination of the Agreement;</SPAN></P>
<P class="p109 ft64"><SPAN class="ft64">c.</SPAN><SPAN class="ft78">THC is dissolved or bankrupt.;</SPAN></P>
<P class="p109 ft64"><SPAN class="ft64">d.</SPAN><SPAN class="ft67">In case of force majeure;</SPAN></P>
<P class="p164 ft70"><SPAN class="ft70">e.</SPAN><SPAN class="ft71">Most of assets of THC has been confiscated by a court decision or other competent authority, therefore it is expected to affect the ability of THC to perform its obligations under this Agreement.</SPAN></P>
<P class="p165 ft70"><SPAN class="ft70">f.</SPAN><SPAN class="ft98">If based on the regulation in effect in the future or based on government policy to THC which requires THC to terminate this Agreement.</SPAN></P>
<P class="p166 ft62">Such termination shall not waive all CUSTOMERs rights to claim on the termination and the consequenses of termination of this Agreement.</P>
<P class="p167 ft64"><SPAN class="ft64">3.</SPAN><SPAN class="ft67">THC shall have the right to suspend or terminate the Service prior to the Customers declaration of subscription termination in the following event:</SPAN></P>
<P class="p168 ft62"><SPAN class="ft62">a.</SPAN><SPAN class="ft81">CUSTOMER fails to fulfill its obligation under the procedures determined by this Agreement; or</SPAN></P>
<P class="p169 ft64"><SPAN class="ft64">b.</SPAN><SPAN class="ft83">The CUSTOMER has committed a breach of such prohibitions as determined by this Agreement; or</SPAN></P>
<P class="p170 ft64"><SPAN class="ft64">c.</SPAN><SPAN class="ft99">A request from the government investigator for investigation purposes under the applicable laws and regulations in the Republic of Indonesia; or</SPAN></P>
<P class="p171 ft76"><SPAN class="ft76">d.</SPAN><SPAN class="ft80">COSTOMERs is applying for termination of the Agreement;</SPAN></P>
<P class="p172 ft64"><SPAN class="ft64">e.</SPAN><SPAN class="ft83">CUSTOMERs is dissolved or bankrupt.;</SPAN></P>
<P class="p154 ft76"><SPAN class="ft76">f.</SPAN><SPAN class="ft87">In case of force majeure;</SPAN></P>
<P class="p173 ft70"><SPAN class="ft70">g.</SPAN><SPAN class="ft100">Most of assets of CUSTOMERs has been confiscated by a court decision or other competent authority, therefore it is expected to affect the ability of CUSTOMERs to perform its obligations under this Agreement.</SPAN></P>
<P class="p174 ft70"><SPAN class="ft70">h.</SPAN><SPAN class="ft100">If based on the regulation in effect in the future or based on government policy to CUSTOMERs which requires CUSTOMERs to terminate this Agreement.</SPAN></P>
<P class="p175 ft62">Such termination shall not waive all THC rights to claim on the termination and the consequenses of termination of this Agreement.</P>
<P class="p176 ft76"><SPAN class="ft76">4.</SPAN><SPAN class="ft77">Any rights and obligations which remain unfulfilled by respective Parties hereto and have accrued prior to termination shall remain to be at the expense of the respective Parties hereto.</SPAN></P>
<P class="p177 ft70"><SPAN class="ft70">5.</SPAN><SPAN class="ft71">With respect to termination hereof as provided for hereunder, the respective Parties hereto agree to waive the provisions of Articles 1266 and 1267 of the Civil Code.</SPAN></P>
